import React from 'react';
import './App.css';
import pokemons from './data';
import Pokedex from './Pokedex';
import Pokemon from './Pokemon';

class App extends React.Component {
  render() { 
    return (
      <div className="App">
          <h1> Pokedex </h1>
          <Pokemon key={pokemons[0].id} pokemon={pokemons[0]}  />
          <button></button>
      </div>
    );
  }
}

export default App;
